import React, { useEffect } from 'react';
import CityCard from './CityCard';

const CityList = ({ cities, setCities, onCityDeleted }) => {
  // Load cities if not already loaded
  useEffect(() => {
    if (cities.length === 0) {
      fetch('/api/cities/')
        .then(res => res.json())
        .then(data => setCities(data))
        .catch(err => console.error('Error loading cities:', err));
    }
  }, [cities, setCities]);

  return (
    <div id="cityList">
      {cities.length > 0 ? (
        cities.map(city => (
          <CityCard key={city.id} city={city} onDelete={onCityDeleted} />
        ))
      ) : (
        <p className="has-text-centered">No cities added yet.</p>
      )}
    </div>
  );
};

export default CityList;
